    END,
    updatedat = NOW()
    WHERE symbol IN ('GWX', 'RVNU', 'MLPR', 'XHE', 'TMFC', 'PTF', 'EBLU', 'SGLC', 'EVNT', 'DLS', 'PHEQ', 'SPSB', 'FLSW', 'ROAM', 'IHE', 'IWS', 'CEW', 'DIVS', 'GDIV', 'QARP');